      function closeNav() {
        document.getElementById("mySidenav").style.display = 'none';
      }
    
    const[isslide, setIsslide] = useState(false);

     const slideclick =()=> {
        setIsslide(!isslide);
     };

    
     
   return(
    <>
 
 { isslide && <div id="mySidenav" class="sidenav">
