  <a href="#">Services</a>
  <a href="#">Clients</a>
  <a href="#">Contact</a>
</div>}

<h2>Animated Sidenav Example</h2>
<p>Click on the element below to open the side navigation menu.</p>
<button  className="open" onClick={slideclick}>&#9776;open</button>

  </>
   )
}

